import { Stack } from '@mui/material';
import  { Link } from 'react-router-dom';
import { logo } from "../utils/constants";
import { SearchBar } from "./";

const Navbar = () => {
  <Stack 
    direction="row" 
    alignItems="center" 
    p={2} 
    sx={{
      position: "sticky", 
      background: "#0000",
      top: 0,
      justifyContent: "space-between" 
    }}>
    <Link 
      to="/"
      style={{
        display: "flex",
        alignItems: "center"
      }}>
      <img 
        sr={logo} 
        alt="logo" 
        style={{ 
          height: 45 
        }} />
      </Link>
      <SearchBar/>
  </Stack>
}

export default Navbar
